import React from 'react'
import '../pages/quiz.css'
import Logo from '../../assets/images/Logo.jpg'
import Home from '../../assets/images/home.png'

const Quiz = () => {

  var qBank = [
    // { id: 1, question: 'Are you?', answer: ['male', 'female', 'I would not describe myself as either'], rating: [20, 10, 10] },
    { id: 1, question: 'Are you?', options: [{ level: 'male', rating: 20 }, { level: 'female', rating: 10 }, { level: 'I would not describe myself as either', rating: 10 }] },


    { id: 2, question: 'What type of home do you live?', options: [{ level: 'Mansion (more than 6 bedrooms)', rating: 10 }, { level: 'Detached', rating: 9 }, { level: 'Cottage', rating: 8 }, { level: 'Semi Detached', rating: 7 }, { level: 'Terrace ( 3 floors)', rating: 7 }, { level: 'Terrace ( 2 floors)', rating: 7 }, { level: 'Bungalow', rating: '6' }, { level: 'Flat (Purpose build)', rating: 5 }, { level: 'Flat (Conversion)', rating: 10 }, { level: 'Town House' }, { level: 'Do you own more that 1 home?', rating: 20 }] },

    { id: 3, question: 'How well is your home insulated?', options: [{level:'Very well'}, `It's OK`, 'Drafts everywhere', `Don't know`], rating: [-5, 5, 10, 15] },
    { id: 4, question: 'How many adults (16+) live in your home?', options: [1, 2, 3, 4, 5, '6+'], rating: [10, 8, 7, 6, 5] }
  ];
  console.log('qBank', qBank);
  // const []

  // const handleChange = (event) => {
  //   setname(event.target.value);
  // }

  return (
    <>
      <section>
        <div className='container'>
          <div className='row'>
            <div className='col ms-10px'>
              <img src={Logo} className='w-25' alt="..." />
              <a href='#'>HOME</a>
              <a href='#'>FOR YOU</a>
              <a href='#'>FOR YOUR BUSINESS</a>
              <a href='#'>CARBON ABSORBING</a>
              <a href='#'>START YOUR AUDIT</a>

              <button className='btn' type='btn'> FIND OUT MORE</button>
            </div>
          </div>

          <div className='row'>
            <div className='col'>
              <img src={Home} className='position-absolute top-50 start-50' alt='home' />
              {/* {qBank.map((i, key) => {

                return (<>
                  <ul key={key}>
                    <li>{i.question}</li>
                    <li><li>{i.answer.map((op) => {
                      return (
                        <>
                          <ul>
                            <li>
                              <input type='radio' name='anwer' />{op}
                            </li>
                          </ul>
                        </>
                      )
                    })}</li>
                      <label className='answers'></label>

                    </li>
                  </ul>
                </>

                )

              })} */}
              {qBank.map((i, key) => {
                return (
                  <ul>
                    {i.options.map((option, key) => {
                      return (
                        <>
                          <li>
                            <input type='radio' name='anwer' value='rating' />
                            <label className='answers'>{option.gender}</label>
                          </li>
                        </>
                      )
                    })}
                  </ul>
                )
              })}


            </div>
          </div>
        </div>
      </section>
    </>
  )
}
export default Quiz;
